import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import { NavLink } from 'react-router-dom';
import 'bootstrap/dist/css/bootstrap.min.css';
import { useContext } from 'react';
import { CartContext } from '../context/CartContext';

function Navb() {
    const { cartItems } = useContext(CartContext);
  return (
    
    <>
      <Navbar bg="light" data-bs-theme="light" expand="lg" collapseOnSelect>
        <Container>
          <Navbar.Toggle aria-controls="main-navbar-nav" />
          <Navbar.Collapse id="main-navbar-nav">
            <Nav className="ms-auto">
              <Nav.Link id="nav" as={NavLink} to="/">
                Home
              </Nav.Link>
              <Nav.Link id="nav" as={NavLink} to="/Addseles">
                Add Sales
              </Nav.Link>
              <Nav.Link id="nav" as={NavLink} to="/Sales">
                Sales
              </Nav.Link>
              <Nav.Link id="nav" as={NavLink} to="/Addpurchase">
                Add purchase
              </Nav.Link>
              <Nav.Link id="nav" as={NavLink} to="/Purchase">
                Purchase
              </Nav.Link>
              <Nav.Link id="nav" as={NavLink} to="Balance">
                Balance
              </Nav.Link> 
            </Nav>
          </Navbar.Collapse>
        </Container>
      </Navbar>
    </>
  );
}

export default Navb;
